const express = require('express');
const cors = require('cors');
const errorHandler = require('./middleware/errorHandler');

const app = express();

// Configuration from environment variables with defaults
const PORT = process.env.PORT || 3001;
const FRONTEND_ORIGIN = process.env.FRONTEND_ORIGIN || 'http://localhost:5173';

// Middleware setup

// CORS configuration - allow frontend origin
app.use(cors({
  origin: FRONTEND_ORIGIN.split(',').map(origin => origin.trim()),
  methods: ['GET', 'POST', 'PUT', 'PATCH', 'DELETE', 'OPTIONS'],
  allowedHeaders: ['Content-Type', 'Authorization'],
  credentials: true,
}));

// JSON body parsing
app.use(express.json());

// Health check endpoint
app.get('/health', (req, res) => {
  res.json({ status: 'ok', timestamp: new Date().toISOString() });
});

// API routes placeholder
// Routes will be added in subsequent tasks:
// - /api/boards
// - /api/columns
// - /api/cards
// - /api/reports

// 404 handler for unmatched routes
app.use((req, res, next) => {
  res.status(404).json({
    error: {
      code: 'NOT_FOUND',
      message: `Route ${req.method} ${req.path} not found`,
    },
  });
});

// Centralized error handling middleware - must be last
app.use(errorHandler);

// Start server only if this file is run directly (not imported for testing)
if (require.main === module) {
  app.listen(PORT, () => {
    console.log(`Kanban API server running on port ${PORT}`);
    console.log(`CORS enabled for: ${FRONTEND_ORIGIN}`);
  });
}

// Export app for testing
module.exports = app;

const { Pool } = require('pg');

/**
 * Database connection pool configuration.
 * Uses DATABASE_URL environment variable for connection string.
 * Pool size is configured for typical development/small production workloads.
 */

// Validate DATABASE_URL is set
if (!process.env.DATABASE_URL && process.env.NODE_ENV !== 'test') {
  console.warn('WARNING: DATABASE_URL environment variable is not set. Using default connection string.');
}

const pool = new Pool({
  connectionString: process.env.DATABASE_URL || 'postgres://kanban:kanban@localhost:5432/kanban',
  // Pool configuration
  max: 20,              // Maximum number of connections in the pool
  min: 2,               // Minimum number of idle connections
  idleTimeoutMillis: 30000,  // Close idle connections after 30 seconds
  connectionTimeoutMillis: 5000,  // Fail connection attempt after 5 seconds
});

// Log pool errors
pool.on('error', (err) => {
  console.error('Unexpected database pool error:', err);
});

/**
 * Execute a parameterized query against the database.
 * Always use parameterized queries to prevent SQL injection.
 *
 * @param {string} text - SQL query with $1, $2, etc. placeholders
 * @param {Array} params - Array of parameter values
 * @returns {Promise<import('pg').QueryResult>} Query result
 *
 * @example
 * const result = await query('SELECT * FROM boards WHERE id = $1', [boardId]);
 */
async function query(text, params) {
  const start = Date.now();
  const result = await pool.query(text, params);
  const duration = Date.now() - start;

  // Log slow queries in development
  if (process.env.NODE_ENV === 'development' && duration > 100) {
    console.log('Slow query detected:', { text, duration: `${duration}ms`, rows: result.rowCount });
  }

  return result;
}

/**
 * Get a client from the pool for transactions.
 * Remember to release the client when done.
 *
 * @returns {Promise<import('pg').PoolClient>} Database client
 *
 * @example
 * const client = await getClient();
 * try {
 *   await client.query('BEGIN');
 *   // ... perform queries
 *   await client.query('COMMIT');
 * } catch (err) {
 *   await client.query('ROLLBACK');
 *   throw err;
 * } finally {
 *   client.release();
 * }
 */
async function getClient() {
  return pool.connect();
}

/**
 * Close all pool connections.
 * Call this when shutting down the application.
 */
async function close() {
  await pool.end();
}

module.exports = {
  pool,
  query,
  getClient,
  close,
};

/**
 * Centralized error handling middleware.
 * Provides consistent error response format across all API endpoints.
 *
 * Error response format:
 * {
 *   error: {
 *     code: 'ERROR_CODE',
 *     message: 'Human-readable error message'
 *   }
 * }
 */

/**
 * Custom API error class with code and status.
 * Use this to throw errors that should be returned to the client.
 */
class ApiError extends Error {
  /**
   * @param {string} code - Error code (e.g., 'NOT_FOUND', 'VALIDATION_ERROR')
   * @param {string} message - Human-readable error message
   * @param {number} status - HTTP status code (default: 500)
   */
  constructor(code, message, status = 500) {
    super(message);
    this.code = code;
    this.status = status;
    this.name = 'ApiError';
  }
}

/**
 * Error codes with their default status codes.
 * Use these when creating ApiError instances.
 */
const ErrorCodes = {
  VALIDATION_ERROR: { status: 400, code: 'VALIDATION_ERROR' },
  NOT_FOUND: { status: 404, code: 'NOT_FOUND' },
  CONFLICT: { status: 409, code: 'CONFLICT' },
  INTERNAL_ERROR: { status: 500, code: 'INTERNAL_ERROR' },
};

/**
 * Express error handling middleware.
 * Must be registered after all routes.
 */
function errorHandler(err, req, res, next) {
  // Log error for debugging (mask sensitive data in production)
  if (process.env.NODE_ENV !== 'test') {
    console.error('Error:', {
      name: err.name,
      message: err.message,
      code: err.code,
      path: req.path,
      method: req.method,
      // Do not log stack trace in production
      stack: process.env.NODE_ENV === 'development' ? err.stack : undefined,
    });
  }

  // Handle known ApiError instances
  if (err instanceof ApiError) {
    return res.status(err.status).json({
      error: {
        code: err.code,
        message: err.message,
      },
    });
  }

  // Handle PostgreSQL specific errors
  if (err.code) {
    // PostgreSQL unique violation
    if (err.code === '23505') {
      return res.status(409).json({
        error: {
          code: 'CONFLICT',
          message: 'A record with this value already exists',
        },
      });
    }

    // PostgreSQL foreign key violation
    if (err.code === '23503') {
      return res.status(400).json({
        error: {
          code: 'VALIDATION_ERROR',
          message: 'Referenced record does not exist',
        },
      });
    }

    // PostgreSQL not null violation
    if (err.code === '23502') {
      return res.status(400).json({
        error: {
          code: 'VALIDATION_ERROR',
          message: `Missing required field: ${err.column}`,
        },
      });
    }
  }

  // Handle JSON parsing errors
  if (err instanceof SyntaxError && err.status === 400 && 'body' in err) {
    return res.status(400).json({
      error: {
        code: 'VALIDATION_ERROR',
        message: 'Invalid JSON in request body',
      },
    });
  }

  // Default to internal server error
  // Avoid leaking internal error details to client in production
  const message = process.env.NODE_ENV === 'production'
    ? 'An unexpected error occurred'
    : err.message || 'An unexpected error occurred';

  res.status(500).json({
    error: {
      code: 'INTERNAL_ERROR',
      message,
    },
  });
}

module.exports = errorHandler;
module.exports.ApiError = ApiError;
module.exports.ErrorCodes = ErrorCodes;

